declare(strict_types=1);

namespace Bat\CustomerGraphQl\Test\Unit\Model\Resolver\Customer;

use Magento\TestFramework\TestCase\GraphQlAbstract;
use PHPUnit\Framework\TestResult;

class UploadLicenseTest extends GraphQlAbstract
{
    /**
     * Product Create API Unit Case
     */
    public function testProductCreate()
    {
        $randDigits = rand(11111, 99999);
        $mobileNumber = '78781'.$randDigits;
        $query
            = <<<MUTATION
 mutation {
  createBatCustomer (
    input:{
        mobilenumber: $mobileNumber
        name: "Test Case"
        company_name: "Test Company"
        virtual_bank:"KB 국민은행"
        consent_identifier: consent
        paper_forms: 1
        business_license:
      {
          business_name : "test.png"
          business_file: "data:image/png;base64,"
      }
      tobacco_seller_license:
      {
          tobacco_name: "lotus.jpg"
          tobacco_file: "data:image/jpeg;base64,"
      }
        address: {
            street : "11 North St"
            city : "Test"
            postcode: "456678"
            }
            })
            {
                customer{
                    email
                    }
            }
}

MUTATION;
        $response = $this->graphQlMutation($query);
        $this->assertIsArray($response['createBatCustomer']);
        $this->assertNotEmpty($response['createBatCustomer']);
        $customerResponse = $response['createBatCustomer']['customer'];
    }
}
